message:
❗️Памятка, что предусматривает чрезвычайное положение

:: особый режим въезда/выезда;

:: ограничение передвижения;

:: усиление охраны общественного порядка и объектов, обеспечивающих жизнедеятельность населения;

:: запрет на проведение массовых мероприятий, забастовок;

Также возможны:

:: комендантский час (при необходимости);

:: проверка документов и осмотр авто;

:: запрет призывникам, военнообязанным и резервистам менять место жительства без ведома соответствующего территориального центра;

:: ограничение на продажу оружия и изъятие его у граждан;

:: ограничение работы СМИ;

:: изъятие имущества.

